import { Table } from "react-bootstrap";
import axios from "axios";
import { useEffect, useState } from "react";
import _ from "lodash";

const FilesInDisplay = () => {
  const [libraryFiles, setLibraryFiles] = useState([]);
  const [error, setError] = useState("");
  useEffect(() => {
    axios
      .get("./fileDetails.json")
      .then((response) => {
        setLibraryFiles(response.data);
      })
      .catch((error) => {
        setError(error);
      });
  }, []);

  function handleCheck(value) {
    console.log(value);
  }

  useEffect(() => {
    libraryFiles.map((val) => {
      console.log("mapped files: ", val);
    });
  }, [libraryFiles]);
  return (
    <>
      <h1>Library Files</h1>
      <Table>
        <thead>
          <tr>
            <th>File Name</th>
            <th>File Size</th>
            <th>Date Created</th>
          </tr>
        </thead>
        <tbody>
          {libraryFiles.map((val, index) => {
            return (
              <tr key={index}>
                <input type="radio" value={val} onClick={handleCheck} />
                <td>{val.name}</td>
                <td>{val.size}</td>
                <td>{val.date}</td>
                <td>
                  <input name="isenabled" type="checkbox" />
                </td>
              </tr>
            );
          })}
        </tbody>
      </Table>
    </>
  );
};

export default FilesInDisplay;
